INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", 2, 24, "アヤネ", 0.0, 2, 10046, 24001, 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", 1, 24, "アヤネ", 2.21, 2, 10046, 24002, 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", 2, 24, "アヤネ", 0.0, 2, 10046, 24003, 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", 2, 24, "アサヒ", 1.99, 1, 10046, 24004, 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", 1, 24, "アサヒ", 2.21, 2, 10046, 24005, 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", 2, 24, "アサヒ", 3.33, 1, 10046, 24006, 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", 2, 24, "部員３", 0.0, 2, 10046, 24007, 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", 1, 24, "部員３", 2.68, 2, 10046, 24008, 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", 2, 24, "部員３", 0.0, 2, 10046, 24009, 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", 1, 24, "", 0.0, 1, 10046, 24010, 501, "やった！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", 1, 24, "", 0.0, 1, 10046, 24011, 502, "勝ったよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", 1, 24, "", 0.0, 1, 10046, 24012, 503, "いい調子！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 6, 24, "ミサト", 5.33, 2, 10046, 24013, 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 1, 24, "ミサト", 6.85, 2, 10046, 24014, 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 1, 24, "ミサト", 3.0, 2, 10046, 24015, 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", 1, 24, "ダイチ", 6.11, 2, 10046, 24016, 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", 1, 24, "ダイチ", 6.75, 2, 10046, 24017, 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192401, "2020/07/31 12:00:00", 2, 24, "ダイチ", 0.0, 2, 10046, 24018, 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", 2, 24, "ハツネ", 4.52, 1, 10046, 24019, 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", 2, 24, "ハツネ", 3.89, 1, 10046, 24020, 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 113401, "2020/07/31 12:00:00", 1, 24, "ハツネ", 13.49, 2, 10046, 24021, 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", 1, 24, "カヤ", 3.17, 2, 10046, 24022, 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", 1, 24, "カヤ", 4.42, 2, 10046, 24023, 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 106501, "2020/07/31 12:00:00", 6, 24, "カヤ", 2.89, 1, 10046, 24024, 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 102301, "2020/07/31 12:00:00", 4, 24, "アヤネ", 3.71, 3, 10046, 24025, 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192201, "2020/07/31 12:00:00", 2, 24, "アサヒ", 5.1, 1, 10046, 24026, 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192301, "2020/07/31 12:00:00", 1, 24, "部員３", 4.34, 3, 10046, 24027, 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (0.0, "2030/12/17 14:59:59", 0.0, 192501, "2020/07/31 12:00:00", 1, 24, "", 0.0, 1, 10046, 24028, 521, "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 1, 24, "ミサト", 5.62, 2, 10046, 24029, 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 1, 24, "ミサト", 9.58, 2, 10046, 24030, 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 2, 24, "ミサト", 0.0, 2, 10046, 24031, 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 2, 24, "ミサト", 9.13, 1, 10046, 24032, 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_69217ca52b37c2f0dde227eca113ae8903a4bb741746d94ec9f4b5d610576ecd` VALUES (-360.0, "2030/12/17 14:59:59", 0.0, 113501, "2020/07/31 12:00:00", 1, 24, "ミサト", 8.27, 2, 10046, 24033, 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
